/* eslint-disable arrow-parens */
import React from 'react';
import { Link as RouterLink } from 'react-router-dom';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import {
  Breadcrumbs,
  Button,
  Grid,
  Link,
  SvgIcon,
  Typography,
  makeStyles
} from '@material-ui/core';
import { Edit as EditIcon } from 'react-feather';
import NavigateNextIcon from '@material-ui/icons/NavigateNext';

const useStyles = makeStyles(theme => ({
  root: {},
  actionIcon: {
    marginRight: theme.spacing(1)
  }
}));

function Header({ className, composition, ...rest }) {
  const classes = useStyles();

  // console.log('view header', composition.entry);
  const entries = composition.entry;
  let patientId = '';
  let compositionId = '';
  for (let i = 0; i < entries.length; i++) {
    // console.log('view header', entries[i].resource.resourceType);
    if (entries[i].resource.resourceType === 'Patient') {
      patientId = entries[i].resource.id;
    }

    if (entries[i].resource.resourceType === 'Composition') {
      compositionId = entries[i].resource.id;
    }
  }

  // console.log('view header', patientId);
  return (
    <Grid
      container
      spacing={3}
      justify="space-between"
      className={clsx(classes.root, className)}
      {...rest}
    >
      <Grid item>
        <Breadcrumbs
          separator={<NavigateNextIcon fontSize="small" />}
          aria-label="breadcrumb"
        >
          <Link
            variant="body1"
            color="inherit"
            to="/app/reports/dashboard/"
            component={RouterLink}
          >
            Dashboard
          </Link>
          <Link
            variant="body1"
            color="inherit"
            to={`/app/reports/dashboard/composition/${patientId}`}
            component={RouterLink}
          >
            Compositions
          </Link>
          <Typography variant="body1" color="textPrimary">
            Document Source View
          </Typography>
        </Breadcrumbs>
        <Typography variant="h3" color="textPrimary">
          {/* {customer.fullName} */}
          Source - Composition Resources
        </Typography>
      </Grid>
      <Grid item>
        <Button
          color="secondary"
          variant="contained"
          component={RouterLink}
          to={`/app/reports/dashboard/composition/document/view/${compositionId}`}
        >
          <SvgIcon fontSize="small" className={classes.actionIcon}>
            <EditIcon />
          </SvgIcon>
          Preview
        </Button>
      </Grid>
    </Grid>
  );
}

Header.propTypes = {
  className: PropTypes.string,
  composition: PropTypes.object.isRequired
};

export default Header;
